typedef long long ll;
typedef long double ld;

const int MAXN = 100100;

int sign[MAXN];
int to[MAXN];

struct monom {
    int sign;
    int mask;
};

monom a[2][MAXN];

void Precalc() {

    a[0][1] = {1, 0};
    a[1][0] = {-1, 1};
    a[1][2] = {1, 0};

    sign[1] = 1;
    to[1] = 0;

    for (int i = 2; i < MAXN; i++) {
        to[i] = -1;
        int k2 = (i & 1);
        int k1 = 1 - k2;
        // a_{k-2} = a[k2]
        // a_{k-1} = a[k1]
        // a_k = a[k1] * x - bk * a[k2]

        for (int j = 1; j <= i; j++) {
            if (a[k1][j - 1].sign != 0 && a[k2][j].sign != 0) {
                int x = a[k1][j - 1].mask ^ a[k2][j].mask;
                assert((x & (x - 1)) == 0);
                int id = __builtin_ctz(x);
                assert(to[i] == -1 || to[i] == id);
                assert(to[i] == -1 || sign[i] == a[k1][j - 1].sign * a[k2][j].sign);
                to[i] = id;
                sign[i] = a[k1][j - 1].sign * a[k2][j].sign;
            }
        }
        if (to[i] == -1) {
            sign[i] = 1;
            assert(__builtin_popcount(i + 1) == 1);
            to[i] = __builtin_ctz(i + 1) - 1;
        }
        //eprintf("b%d = %d * b%d\n", i, sign[i], (1 << (to[i] + 1)) - 1);
        for (int j = i+1; j >= 0; j--) {
            if (j >= 1 && a[k1][j - 1].sign != 0 && a[k2][j].sign != 0) {
                a[k2][j] = {0, 0};
            } else if (j >= 1 && a[k1][j - 1].sign != 0) {
                a[k2][j] = a[k1][j - 1];
            } else if (a[k2][j].sign != 0) {
                a[k2][j] = {-a[k2][j].sign * sign[i], a[k2][j].mask ^ (1 << to[i])};
            } else {
                a[k2][j] = {0, 0};
            }
        }
    }

    string prec(MAXN,' ');
    for (int i = 0; i < MAXN; i++) {
        if (sign[i] == 1) {
            prec[i] = 'a' + to[i];
        } else {
            prec[i] = 'A' + to[i];
        }
    }
    printf("%s\n", prec.c_str());
}

const char *prec = "";

void solve() {
    int n;
    scanf("%d", &n);
    vector<int> b(n);
    for (int &x: b) scanf("%d", &x);
    vector<int> positive(100);
    vector<int> negative(100);
    for (int i = 1; i <= n; i++) {
        if (b[i - 1] * sign[i] == 1) {
            positive[to[i]]++;
        } else {
            negative[to[i]]++;
        }
    }
    int ans = 0;
    for (int i = 0; i < 100; i++) {
        ans += min(positive[i], negative[i]);
    }
    printf("%d\n", ans);
}

int main() {
#ifdef LOCAL
  freopen("d.in", "r", stdin);
  freopen("d.out", "w", stdout);
#endif

  //Precalc();
  for (int i = 0; i < MAXN; i++) {
      if ('a' <= prec[i] && prec[i] <= 'z') {
          to[i] = prec[i] - 'a';
          sign[i] = 1;
      } else {
          to[i] = prec[i] - 'A';
          sign[i] = -1;
      }
  }

  int t;
  scanf("%d", &t);
  while (t-->0) {
      solve();
  }

  return 0;
}
